  display: flex;
`

const Container = styled.div`
  background-color: #0e0e10;

  min-height: 100vh;
`

const Home = () => {
  return (
    <>
      <Container>
        <ListOfOptions />
        <ListOfCards />
      </Container>
    </>
  )
}

export default Home
